import React, { useEffect } from 'react';
import { Card, Button, CardTitle, CardText, Row, CardBody, Container, Table } from 'reactstrap';
import { connect } from 'react-redux';
import { deleteItemFromCart } from '../../actions/cart';
import { Item as ItemType } from '../../reducers/types';

function Item(props: any): JSX.Element {
    return (
        <Container>
            <Row>
                <div>
                    <Card>
                        <CardImg top width="100%" src="/assets/318x180.svg" alt="Card image cap" />
                        <CardBody>
                            <CardTitle>Card title</CardTitle>
                            <CardSubtitle>Card subtitle</CardSubtitle>
                            <CardText>
                                Some quick example text to build on the card title and make up the bulk of the card's
                                content.
                            </CardText>
                            <Button>Button</Button>
                        </CardBody>
                    </Card>
                </div>
            </Row>
        </Container>
    );
}

const mapStateToProps = (state: any) => {
    console.log(state);
    return {
        items: state.cart.items,
    };
};

export default connect(mapStateToProps, { deleteItemFromCart })(Item);
